import { BrowserRouter, Link } from "react-router-dom";
import "./App.css";
import "./Assets/brand-logo/logo.svg";

function App() {
  return (
    <div className="App">
      <div className="app">
        <h1>Bookkeeper</h1>
        <nav
          style={{
            borderBottom: "solid 1px",
            paddingBottom: "1rem",
          }}
        >
          <Link to="/about">Invoices</Link> | <Link to="/about">Expenses</Link>
        </nav>
      </div>
    </div>
  );
}

